window.bookSummaryJSON = "<p><b>To repay his debt to Shal, Randidly Ghosthound fought his way through the preliminaries of the Under-25 Regional Tournament in Tellus. </b></p> <p>His victories have earned him a spot in Deardun, the seat of power in the Northern Domain. But in this new venue, there are storms brewing on the horizon. Now he’s not just fighting against the unaffiliated warriors, he's one injury or loss away from becoming a Forsaken.</p> <p>The affluent Styles that rule the Northern Domain have passed the championship between each other over the last five decades, and they aren’t willing to surrender it now. </p> <p>Yet an even larger shadow looms on the horizon...</p> <p>Representatives from the autocratic Central Domain have infiltrated the tournament, looking for clues about an old mystery: the true story of the Shal’s father—the original Spear Phantom—and the location of the third gift he received from the Witch of Karma, Lucretia.</p> <p><b>Book 3 of the hit LitRPG Fantasy series with over 50 Million views on Royal Road. </b></p>"; 
